               class PayoffTable {
    constructor() {
        this.payoffTable;
    }

    getPayoffTable = function(){
        return this.payoffTable;
    }
    
    setPayoffTable = function(tradeStructure) {
        this.payoffTable = [];
        let strikes = getStrikes(tradeStructure);
    }

    getStrikes = function(tradeStructure) {
        let strikes = [];
        
        tradeStructure.Options.forEach(option => {
            if (!strikes.includes(option.k)) {
                strikes.push(option.k);
            } 
        });
        strikes.sort();
        return strikes;
    }
}
